import React from "react";
import "./styles.css";

function Card(props) {
  return (
    <div
      className={`card`}
      key={props.uniqueKey}
      style={{ gridColumnStart: props.gridColumnStart, gridRowStart: props.gridRowStart }}
    >
      <div className="gif">
        <img
          src={props.url}
          alt={props.alt}
          style={{
            width: "100%",
            height: "100%",
            borderRadius:"40%"
          }}
        />
      </div>
      <h2 className="name" style={{left:props.left,right:props.ri}}>{props.name}</h2>
    </div>
  );
}

export default Card;
